import './App.css';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Navbar from "../src/Components/Navbar/Navbar"
import Slider from './Components/Slider/Slider';
import GTA from './pages/GTA';
import COD from './pages/COD';
import Fortnite from './pages/Fortnite';

function App() {
  return (
    <BrowserRouter>
      <Routes>
      <Navbar />
        <Route path='/' component={Slider} />
        <Route path='/gta' component={GTA} />
        <Route path='/cod' component={COD} />
        <Route path='/fortnite' component={Fortnite} />
      </Routes>
      {/* 
        <Route path='/gta'>
          <GTA />
        </Route>
        <Route path='/cod'>
          <COD />
        </Route>
        <Route path='/fortnite'>
          <Fortnite />
        </Route> */}
      {/* </Routes> */}
    </BrowserRouter>



  );
}

export default App;
